import React from 'react';
import { Link } from 'react-router-dom';

import './Image.css';

const Image = props => {
	return (
		<a href="{props.href}">
			<img src={props.src} alt={props.alt} onClick={props.onClick}></img>
		</a>
	);
};

export default Image;
